    - type: Paper
      content: >2
                                            [head=1]Rules For [/head]

                              [head=1]Capture The Flag[/head]

        A.) Setup

        Each team consists of the same number of players

        Each player is allowed to bring two plungers, 

        one in each hand

        At no time are you to store them in a bag, two is the maximum amount of plungers for each player

        Each team is given a set of inflatable barriers, these are yours to set up and create your defense for your flag

        before the round starts.


        B.)Playing

        If you get tagged with a plunger you must walk, 

        you are out. 

        You cannot throw plungers while you are out.

        If you are out, you must walk back to your base, and remove the plunger, now you are back in the game.

        The goal is to get the other team's flag back to your base.

        You cannot pick up your team's flag unless it is to return it to base.

        If you get tagged while carrying a flag, you are able to toss the flag in any direction as far as youd like.
